column8:
毎日の新習慣<br>

明日の自分はもっと魅力的<br><br>

≪お召し上がり方≫<br>
1日3 粒を目安に水やぬるま湯と一緒にお召し上がりください。<br><br>

【原材料】<br>
ゼラチン、亜麻仁油、リンゴエキス末、プエラリアミリフィカ、鮭卵巣膜エキス末、大豆エキス末、落花生種皮エキス末、ショウガエキス、ビタミンE含有植物油、ツバキ油、ツバキ種子エキス末、酒酵母粉末(サミー含有)、ブドウレスベラトロール末(新芽・若つる由来)、セラミド含有パイナップル果実エキス末、生物ミネラル、グリセリン、トコトリエノール、コメヌカロウ、グリセリン脂肪酸エステル、シクロデキストリン、L-メチオニン、植物レシチン <br>
【栄養成分】 3粒(1.41g)あたり<br>
エネルギー 7.87kcal、たんぱく質 0.43g 脂質 0.53g、炭水化物 0.35g、ナトリウム 4.94mg、ビタミンE 16.00mg<br><br>
※1日あたりの栄養素等表示基準値に占める割合<br>
(3粒あたり):ビタミンE 200%<br><br>

